import React from 'react';
import './PopSearchPageStyles.scss';
import PopSearchHeader from './PopSearchHeader';
import CardList from '../../components/collection-card/CardList';
import { popinfo } from './popinfo';

import PopYTpage from './PopYoutubePage';


const PopSearchPage = () => (
	<div>
		<PopSearchHeader />
		<div className='card-section'>
			<CardList className='data-review' popinfo={popinfo} />
		</div>
		<PopYTpage />
	</div>
)

export default PopSearchPage;
